import background from '../images/background.jpg';

const Hero = () => {
  return (
    <section
      className="min-h-screen flex items-center justify-center bg-cover bg-center"
      style={{ backgroundImage: `url(${background})` }}
    >
      <div className="bg-white bg-opacity-70 p-8 rounded shadow text-center">
        <h2 className="text-4xl font-bold mb-4">Innovative IT Solutions</h2>
        <p className="text-lg">Empowering your business with technology</p>
      </div>
    </section>
  );
};

export default Hero;
